pragma solidity ^0.8.3;

contract Loop {
    uint public count;

    function loop() public {
        // for loop
        for (uint i = 0; i < 18; i += 2) {
            if (i == 5) {
                // Skip to next iteration with continue
                continue;
            }
            if (i == 5) {
                // Exit loop with break
                break;
            }
            count++;
        }

        // while loop
        uint j;
        while (j < 10) {
            j++;
        }
    }
}

